function createPDF(){ //creates pdf

  x = 10; //resets cords in case pdf is re dowloaded
  y = 20;

  pdf = new jsPDF(); //erases pdf object

  const BODY = 12; //constants for body and title font size
  const TITLE = 20;

  InsName = document.getElementById("name").value; //gets users input
  courseName = document.getElementById("courseName").value;
  courseDes = document.getElementById("courseDes").value;
  insEmail = document.getElementById("insEmail").value;
  insPhone = document.getElementById("insPhone").value;
  preReq = document.getElementById("preReq").value;
  attenPol = document.getElementById("attenPol").value;
  acadHonest = document.getElementById("acadHonest").value;
  gradeDet = document.getElementById("gradeDet").value;
  assignments = document.getElementById("assignments").value;
  biblio = document.getElementById("biblio").value;
  teachAct = document.getElementById("teachAct").value;
  accommod = document.getElementById("accommod").value;
  if(document.getElementById("times").checked){
    font = "times";
  }
  else if(document.getElementById("helvetica").checked){
    font = "helvetica";
  }
  else{
    font = "courier";
  }

  if(document.getElementById("circle").checked){
    logo = "circle";
  }
  else if(document.getElementById("sport").checked){
    logo = "sport";
  }
  else{
    logo = "simple";
  }

  console.log(font);
  console.log(logo);

  if(logo == "circle"){ //adds logo
    if(Math.random > .05){
      var imgData = "data:image/png;base64,";
    }
    else{
      imgData = "data:image/png;base64,";
    }

    pdf.addImage(imgData , "PNG" , 15 , 7 , 40 , 40);
  }
  else if (logo == "sport"){
    imgData = "data:image/png;base64,";

    pdf.addImage(imgData , "PNG" , 15 , 10 , 40 , 40);
  }
  else if (logo == "Simple"){
    imgData = "data:image/png;base64,";

    pdf.addImage(imgData , "PNG" , 0 , 15 , 40 , 65);
  }

  //pdf.setFont("times" , "light")

  //calls write function to write to the pdf
  write(courseName + "  " + InsName , "bold" , TITLE , x + 55);
  skipLine();
  write("Instructor Contact:" , "bold" , BODY , x + 55);
  write(("E-mail: " + insEmail) , "light" , BODY , x + 55);
  write("Phone: " + insPhone , "light" , BODY , x + 55);
  skipLine();
  write("Course Description:" , "bold" , BODY , x);
  write(courseDes , "light" , BODY , x);
  skipLine();
  write("Pre Requisites:" , "bold" , BODY , x);
  write(preReq , "light" , BODY , x);
  skipLine();
  write("Attendance Policy:" , "bold" , BODY , x);
  write(attenPol , "light" , BODY , x);
  skipLine();
  write("Statement on Academic Honesty:" , "bold" , BODY , x);
  write(acadHonest , "light" , BODY , x);
  skipLine();
  write("Basis of Grade Determination:" , "bold" , BODY , x);
  write(gradeDet , "light" , BODY , x);
  skipLine();
  write("Assignments:" , "bold" , BODY , x);
  write(assignments , "light" , BODY , x);
  skipLine();
  write("Sources / Other Resources:" , "bold" , BODY , x);
  write(biblio , "light" , BODY , x);
  skipLine();
  write("TEACH Act Disclosure:" , "bold" , BODY , x);
  write(teachAct , "light" , BODY , x);
  skipLine();
  write("Accommodations & Assesibilty Statement:" , "bold" , BODY , x);
  write(accommod , "light" , BODY , x);
  skipLine();

  pdf.save(InsName + "_" + courseName + "_syllabus.pdf");

}

